const StackNavigator = ({ userType }) => {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="LoginScreen"
        component={LoginScreen}
        options={{ headerShown: false }}
      />
      <Stack.Screen
        name="SignUpScreen"
        component={SignUpScreen}
        options={{
          headerShown: false,
        }}
      />
      <Stack.Screen
        name="HomeScreen"
        component={() => <HomeTabNavigator userType={userType} />}
        options={{
          headerShown: false,
        }}
      />
      {userType !== "doctor" && (
        <Stack.Screen
          name="ProfileScreen"
          component={ProfileScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
      <Stack.Screen
        name="EditProfileScreen"
        component={EditProfileScreen}
        options={{
          headerShown: false,
        }}
      />
      {userType === "patient" && (
        <Stack.Screen
          name="DietScreen"
          component={DietScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
      {userType === "doctor" && (
        <Stack.Screen
          name="DoctorProfileScreen"
          component={DoctorProfileScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
      {userType === "patient" && (
        <Stack.Screen
          name="PatientFormScreen"
          component={PatientFormScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
      {userType === "doctor" && (
        <Stack.Screen
          name="DoctorFormScreen"
          component={DoctorFormScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
      {userType === "patient" && (
        <Stack.Screen
          name="WorkoutScreen"
          component={WorkoutScreen}
          options={{
            headerShown: false,
          }}
        />
      )}
    </Stack.Navigator>
  );
};

export default StackNavigator;
